import React from "react";

const About = () => {
  return (
    <div
      className="container-fluid d-flex justify-content-center align-items-center about-container-desktop"
      id="desktopContainer"
    >
      <p id="aboutScrollContent">Hello! I'm Gabriel.</p>
    </div>
  );
};

export default About;
